CREATE DEFINER=`admin`@`%` PROCEDURE `insert_codes` (IN `numRecords` INT)   BEGIN
    DECLARE i INT DEFAULT 0;
    DECLARE randomName VARCHAR(5);
    
    -- Bucle para insertar los registros
    WHILE i < numRecords DO
        -- Generar un nombre único alfanumérico aleatorio de 5 caracteres en mayúsculas
        SET randomName = '';
        WHILE randomName = '' OR EXISTS (SELECT 1 FROM codes WHERE name = randomName) DO
            SET randomName = CONCAT(
                CHAR(FLOOR(65 + RAND() * 26)), 
                CHAR(FLOOR(65 + RAND() * 26)),
                CHAR(FLOOR(65 + RAND() * 26)),
                CHAR(FLOOR(65 + RAND() * 26)),
                CHAR(FLOOR(65 + RAND() * 26))
            );
        END WHILE;

        -- Insertar el registro en la tabla codes
        VALUES (NULL, randomName, 0, NOW());

        -- Incrementar el contador
        SET i = i + 1;
    END WHILE;
END$$

