CREATE DEFINER=`admin`@`%` PROCEDURE `select_group_users` ()   SELECT
    u.id,
    u.name,
    u.mail,
    u.phone,
    u.identification_number,
    u.date,
    u.cityName,
    u.documentType,
    (COALESCE(scores_sum.total_scores, 0) + COALESCE(referrals_sum.total_referrals, 0)) AS total_points,
    o.type,
    o.cdlMasterlub
FROM
    offices o
JOIN users u ON o.cdlMasterlub = (SELECT s.locate FROM scores s WHERE s.user_id = u.id LIMIT 1)
LEFT JOIN (
    SELECT
        s.user_id,
        SUM(s.points) AS total_scores
    FROM
        scores s
    GROUP BY
        s.user_id
) scores_sum ON u.id = scores_sum.user_id
LEFT JOIN (
    SELECT
        r.user_id_referral AS user_id,
        SUM(r.points) AS total_referrals
    FROM
        referrals r
    GROUP BY
        r.user_id_referral
) referrals_sum ON u.id = referrals_sum.user_id$$

