CREATE DEFINER=`admin`@`%` PROCEDURE `select_referrals` (IN `prmNameOrPhone` VARCHAR(50))   BEGIN
    IF prmNameOrPhone IS NULL THEN
        SELECT r.id, r.points, u.name AS user_name, su.name AS referral_name, r.date,r.locate  
        FROM referrals AS r
        LEFT JOIN users u ON r.user_id = u.id
        LEFT JOIN users su ON r.user_id_referral = su.id;
    ELSE
        SELECT r.id, r.points, u.name AS user_name, su.name AS referral_name, r.date, r.locate  
        FROM referrals AS r
        LEFT JOIN users u ON r.user_id = u.id
        LEFT JOIN users su ON r.user_id_referral = su.id
        WHERE LOWER(u.name) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'))
           OR LOWER(u.phone) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'))
           OR LOWER(su.name) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'))
           OR LOWER(su.phone) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'));
    END IF;
END$$

