CREATE DEFINER=`admin`@`%` PROCEDURE `select_report` ()   WITH CodeData AS (
    SELECT 
        c.user_id,
        c.name AS code,
        c.date AS codeDate,
        CASE 
            WHEN c.registered = 1 THEN 'registrado'
            ELSE c.registered 
        END AS codeRegistered,
        c.locate AS codeRegisteredLocate,
        ROW_NUMBER() OVER (PARTITION BY c.user_id ORDER BY c.date) AS row_num
    FROM codes c
),
ScoreData AS (
    SELECT 
        s.user_id,
        s.points AS scorePoints,
        s.locate AS scoreLocate,
        s.date AS scoreDate,
    	Off.type AS Type,
        ROW_NUMBER() OVER (PARTITION BY s.user_id ORDER BY s.date) AS row_num
    FROM scores s
    LEFT JOIN offices AS Off ON s.locate = Off.cdlMasterlub
),
InvoiceData AS (
    SELECT 
        i.user_id,
        i.name AS invoiceName,
        i.date AS invoiceDate,
        ROW_NUMBER() OVER (PARTITION BY i.user_id ORDER BY i.date) AS row_num
    FROM invoice i
)

SELECT 
    u.id AS "id",
    u.name AS "name", 
    u.mail AS "mail", 
    u.phone AS "phone", 
    u.identification_number AS "identification_number", 
    u.date AS "userDate", 
    u.cityName AS "cityName", 
    u.documentType AS "documentType", 

    cd.code,
    cd.codeDate,
    cd.codeRegistered,
    cd.codeRegisteredLocate,
	
    sd.Type,
    sd.scorePoints,
    sd.scoreLocate,
    sd.scoreDate,

    id.invoiceName,
    id.invoiceDate

FROM 
    users u
LEFT JOIN 
    CodeData cd ON cd.user_id = u.id
LEFT JOIN 
    ScoreData sd ON sd.user_id = u.id AND sd.row_num = COALESCE(cd.row_num, 1)
LEFT JOIN 
    InvoiceData id ON id.user_id = u.id AND id.row_num = COALESCE(cd.row_num, 1)
ORDER BY 
    u.id, cd.row_num$$

CREATE DEFINER=`admin`@`%` PROCEDURE `select_scores` (IN `prmNameOrPhone` VARCHAR(50))   BEGIN
    IF prmNameOrPhone IS NULL THEN
        SELECT scores.id, points, u.name,scores.locate, scores.date 
        FROM scores
        LEFT JOIN users u ON scores.user_id = u.id;
    ELSE
        SELECT scores.id, points, u.name,scores.locate, scores.date 
        FROM scores
        LEFT JOIN users u ON scores.user_id = u.id 
         WHERE LOWER(u.name) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'))
           OR LOWER(u.phone) LIKE LOWER(CONCAT('%', prmNameOrPhone, '%'));
    END IF;
END$$

CREATE DEFINER=`admin`@`%` PROCEDURE `select_scores_referrals` (IN `prmUserId` INT)   BEGIN
    SELECT users.name, scores.user_id, scores.points, scores.date 
    FROM scores 
    INNER JOIN users ON scores.user_id = users.id
    WHERE scores.user_id = prmUserId
    
    UNION ALL
    
    SELECT users.name, referrals.user_id_referral AS user_id, referrals.points, referrals.date 
    FROM referrals 
    INNER JOIN users ON referrals.user_id_referral = users.id
    WHERE referrals.user_id_referral = prmUserId;
END$$

CREATE DEFINER=`admin`@`%` PROCEDURE `select_users` ()   BEGIN
    SELECT 
    u.id, 
    u.name, 
    u.mail, 
    u.phone, 
    u.identification_number, 
    u.date,
    u.cityName,
    u.documentType,
    (COALESCE(MAX(scores_max.total_scores), 0) + COALESCE(SUM(referrals_sum.total_referrals), 0)) AS total_points
FROM 
    users u
LEFT JOIN (
    SELECT 
        s.user_id, 
        MAX(s.points) AS total_scores
    FROM 
        scores s
    GROUP BY 
        s.user_id
) scores_max 
    ON u.id = scores_max.user_id
LEFT JOIN (
    SELECT 
        r.user_id_referral AS user_id, 
        SUM(r.points) AS total_referrals
    FROM 
        referrals r
    WHERE 
        r.user_id_referral != r.user_id -- Excluye los referidos a sí mismos
    GROUP BY 
        r.user_id_referral
) referrals_sum 
    ON u.id = referrals_sum.user_id
GROUP BY 
    u.id, u.name, u.mail, u.phone, u.identification_number, u.date, u.cityName, u.documentType
ORDER BY 
    total_points DESC;
END$$

